  'LBL_SEARCH_HELP_TEXT' => '<p><br /><strong>Controlos Multi-selecção</strong></p><br /><ul><li>Clique nos valores para seleccionar um atributo.</li><br /><li> Faça Ctrl-click para seleccionar múltiplo. Utilizadores de Mac usam CMD-click.</li><br /><li>Para seleccionar todos os valores entre dois atributos, clique no primeiro valor e depois faça shift-click no último valor.</li></ul><br /><p><strong>Opções de Pesquisa Avançada &amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp; Layout</strong><br><br /><br>Ao utilizar a opção <b>Pesquisa Gravada &amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp; Layout</b>, pode gravar um conjunto de parâmetros de pesquisa e/ou um layout Ver Lista personalizado de forma a obter rapidamente no futuro os resultados de pesquisa desejados. Pode gravar um número ilimitado de pesquisas personalizadas e layouts. Todas as pesquisas gravadas aparecem por nome na lista Pesquisas Gravadas, com a última pesquisa gravada carregada a aparecer no topo da lista.<br><br /><br>Para personalizar o layout Ver Lista, utilize as caixas Ocultar Colunas e Exibir Colunas para seleccionar os campos a exibir nos resultados da pesquisa. Por exemplo, pode visualizar ou ocultar detalhes tais como o nome de registo, o utilizador ou a equipa atribuída nos resultados da pesquisa. Para adicionar uma coluna a Ver Lista, seleccione o campo da lista Ocultar Colunas e utilize a seta esquerda para movê-lo para a lista Exibir Colunas. Para remover uma coluna de Ver Lista, seleccione-a da lista Exibir Colunas e utilize a seta direita para movê-la para a lista Ocultar Colunas.<br><br /><br>Se gravar as configurações do layout, poderá carregá-las em qualquer altura para visualizar os resultados de pesquisa no layout personalizado.<br><br>Para gravar e actualizar uma pesquisa e/ou layout:<br /><ol><br /><li>Insira um nome para os resultados da pesquisa no campo <b>Gravar esta pesquisa como</b> e clique em <b>Gravar</b>. O nome é agora exibido na lista Pesquisas Gravadas adjacente ao botão <b>Limpar</b>.</li><br /><li>Para visualizar uma pesquisa gravada, seleccione-a da lista Pesquisas Gravadas. Os resultados da pesquisa são exibidos em Ver Lista.</li><br /><li>Para actualizar as propriedades de uma pesquisa gravada, seleccione a pesquisa gravada da lista, insira o novo critério de pesquisa e/ou opções de layout na área Pesquisa Avançada, e clique em <b>Actualizar</b> a seguir a <b>Modificar Pesquisa Actual</b>.</li><br /><li>Para eliminar uma pesquisa gravada, seleccione-a na lista Pesquisas Gravadas, clique em <b>Eliminar</b> a seguir a <b>Modificar Pesquisa Actual</b>, e clique depois em <b>OK</b> para confirmar a eliminação.</li><br /></ol><p><strong>Dicas</strong><br><br /><br>Ao usar o %, como operador wildcard você pode fazer sua pesquisa com um critério mais amplo. Por exemplo, em vez de apenas realizar uma busca de resultados iguais a "Peras", você poderá alterar a sua pesquisa para "%Peras" que seria compatível com todos os resultados que comecem com a palavra Peras, mas pode conter outros termos.</p>',
