  'LBL_TOUR_SCREEN_1_DESCRIPTION_670' => '<div style="float: left;"><div style="float: left; width: 300px;"><ul><li class="icon-ok">Definir os parâmetros de previsão</li><li class="icon-ok">Seguir facilmente as vendas projectadas e a saúde do pipeline</li><li class="icon-ok">Previsões baseadas em vendas projectadas pela sua equipa de vendas</li></ul></div><div class="well" style="float: left; width: 220px; margin-left: 20px;"><img src="themes/default/images/pt-screen1-thumb.png" width="220" id="thumbnail_1" class="thumb"></div></div><div class="clear"></div>',
  'LBL_TOUR_SCREEN_1_TITLE_670' => 'Funcionalidade de previsão melhorada no Sugar',
  'LBL_TOUR_SCREEN_2_DESCRIPTION_670' => '<div style="float: left;"><div style="float: left; width: 300px;"><ul><li class="icon-ok">Escolha a data de início do ano fiscal</li><li class="icon-ok">Defina Períodos de Tempo como anual ou por quadrimestral</li><li class="icon-ok">Decida quantos Períodos de Tempo passados ou futuros terão que ser visíveis na folha de trabalho</li><li class="icon-ok">Seleccione os limites da previsão para indicar as Oportunidades como Incluir, Excluir ou Inverso</li><li class="icon-ok">Seleccione cenários de previsão para identificar previsões Prováveis, Melhores ou Piores</li></ul></div><div class="well" style="float: left; width: 220px; margin-left: 20px;"><img src="themes/default/images/pt-screen2-thumb.png" width="220" id="thumbnail_2" class="thumb"></div></div><div class="clear"></div>',
  'LBL_TOUR_SCREEN_2_TITLE_670' => 'Definir os parâmetros para a efectuar a previsão',
  'LBL_TOUR_SCREEN_3_DESCRIPTION_670' => '<div style="float: left;"><div style="float: left; width: 300px;"><ul><li class="icon-ok">Seleccionar o Período de Tempo para rever a previsão</li><li class="icon-ok">Visualizar as folhas de trabalho das vendas dos membros da equipa de venda e fornecer previsões ajustadas</li><li class="icon-ok">Ver alerta na folha de trabalho quando um membro da equipa de vendas introduz uma nova previsão</li><li class="icon-ok">Gravar a folha de trabalho de previsões como um rascunho ou enviar a previsão para o seu gestor</li><li class="icon-ok">Visualizar o histórico de introduções anteriores</li></ul></div><div class="well" style="float: left; width: 220px; margin-left: 20px;"><img src="themes/default/images/pt-screen3-thumb.png" width="220" id="thumbnail_3" class="thumb"></div></div><div class="clear"></div>',
  'LBL_TOUR_SCREEN_3_TITLE_670' => 'Gerir as Vendas Projectadas pela sua Equipa de Vendas',
  'LBL_TOUR_SCREEN_4_DESCRIPTION_670' => '<div style="float: left;"><div style="float: left; width: 300px;"><ul><li class="icon-ok">Visualizar o gráfico de Pareto para uma analise do pipeline sobre todas as previsões dos membros da equipa de vendas</li><li class="icon-ok">Escolher para visualizar as vendas projectadas por previsões Prováveis, Melhores ou Piores</li><li class="icon-ok">Visualizar as vendas projectadas e quanto próximo está de atingir a quota da sua equipa</li></ul></div><div class="well" style="float: left; width: 220px; margin-left: 20px;"><img src="themes/default/images/pt-screen4-thumb.png" width="220" id="thumbnail_4" class="thumb"></div></div><div class="clear"></div>',
  'LBL_TOUR_SCREEN_4_TITLE_670' => 'Gerir as Vendas Projectadas da Equipa de Vendas',
